-- SCRIPT FINAL: MITJANES HISTÒRIQUES AMB INTEGRACIÓ EXSOCIS
-- =================================================================
-- Data: 2025-09-21 12:39:57
-- Registres: 1998 (exclou capçalera)
-- IDs exsocis: 14-34 (integrats a la taula socis amb estat 'baixa')
-- IDs socis actius: 8748+ (evita conflictes)
-- =================================================================

BEGIN;

-- Eliminar dades existents de mitjanes històriques
DELETE FROM mitjanes_historiques;

-- Inserir mitjanes històriques actualitzades

-- Verificacions finals
SELECT COUNT(*) as total_mitjanes_inserides FROM mitjanes_historiques;

-- Verificar integració amb exsocis
SELECT 
    s.numero_soci,
    s.nom,
    s.de_baixa,
    COUNT(mh.id) as mitjanes_count
FROM socis s
LEFT JOIN mitjanes_historiques mh ON s.numero_soci = mh.soci_id
WHERE s.de_baixa = TRUE
GROUP BY s.numero_soci, s.nom, s.de_baixa
ORDER BY s.numero_soci;

-- Resum per modalitat
SELECT modalitat, COUNT(*) as total FROM mitjanes_historiques GROUP BY modalitat ORDER BY modalitat;

-- Resum per període
SELECT 
    CASE 
        WHEN year BETWEEN 2003 AND 2010 THEN '2003-2010'
        WHEN year BETWEEN 2011 AND 2020 THEN '2011-2020'
        WHEN year >= 2021 THEN '2021-2025'
    END as periode,
    COUNT(*) as total
FROM mitjanes_historiques 
GROUP BY 
    CASE 
        WHEN year BETWEEN 2003 AND 2010 THEN '2003-2010'
        WHEN year BETWEEN 2011 AND 2020 THEN '2011-2020'
        WHEN year >= 2021 THEN '2021-2025'
    END
ORDER BY periode;

COMMIT;

